            <Form onSubmit={() => this.props.onSubmit(this.state)}>
                <Form.Input fluid label="Entreprise" placeholder="Entreprise"
                    onChange={this.handleChange.bind(this, form.name)} />;
                <Form.Button>{this.props.submitButtonText}</Form.Button>
            </Form>);
    }
}
